ACM Q5791 試題:Box of Bricks 題目難度:一顆星解(C++):#include <iostream>using namespace std;int main(){    int bricks_count = 0,input_count = 0;    while(cin >> bricks_count && bricks_count != 0)    {        int *input = new int[bricks_count];        int Average = 0,answer = 0;        input_count++;        for(int i=0;i<bricks_count;i++)        {            cin >> *(input + i);            Average += *(input + i);        }        Average /= bricks_count;        for(int i=0;i<bricks_count;i++)        {            if(*(input + i) > Average)            {answer+=(*(input + i)-Average);}        }        cout << "Set #" << input_count << "
";        cout << "The minimum number of moves is " << answer << ".

";    }    return 0;}
